    constructor(props){
        super(props);
        // This binding is necessary to make `this` work in the callback
        this.handleClick = this.handleClick.bind(this)
        this.state = {
            count: 0
        };
    }

    render() {
        return(
            <Button color="yellow" onClick={this.handleClick}> {this.state} </Button>
        );
    }
}
